import React, {Component} from 'react';

class Producto extends Component {
    render() {
        return (
            <div>
                <h3>Nombre: {this.props.name}</h3>
                <h5>Precio: {this.props.prices}</h5>
            </div>
        );
    }
}
export default Producto;
